	 function selectedObject(me)
	 { 
	 chosenObjId=me;
	 }
	 
	 function  rotateObj( )
	 {
	 
  
	 if (typeof ObjDataList[0] != 'undefined' && ObjDataList[0] != null   ) {
	     $("#"+chosenObjId).removeClass("rotate-90");
	     $("#"+chosenObjId).removeClass("rotate-180");
	     $("#"+chosenObjId).removeClass("rotate-270");
	     $("#"+chosenObjId).removeClass("rotate-0");
	     $("#"+chosenObjId).removeClass("rotate-45");
	     $("#"+chosenObjId).removeClass("rotate-135");
	     $("#"+chosenObjId).removeClass("rotate-225");
	     $("#"+chosenObjId).removeClass("rotate-315");

	 ObjDataList[0].rotationAngleId+=1
		if(ObjDataList[0].rotationAngleId == 0)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-90');
 		 }
		 else if(ObjDataList[0].rotationAngleId == 1)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-180');
 		 }
		 else if(ObjDataList[0].rotationAngleId == 2)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-270');
 		 }
		  else  if(ObjDataList[0].rotationAngleId ==3)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-0');
		 }
		  else if(ObjDataList[0].rotationAngleId == 4)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-45');
 		 }
		   else if(ObjDataList[0].rotationAngleId == 5)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-135');
 		 }
		    else if(ObjDataList[0].rotationAngleId == 6)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-225');
 		 }
		  else if(ObjDataList[0].rotationAngleId == 7)
		{
 	     $("#"+chosenObjId).toggleClass('rotate-315');
		 		 		 ObjDataList[0].rotationAngleId=-1;

 		 }
		
 }  
 console.log("Result ID:" + ObjDataList[0].rotationAngleId);
